








using namespace std;
typedef long long ll;

int main()
{
	ios::sync_with_stdio(false), cin.tie(false), cout.tie(false);
	int n;
	cin >> n;
	if (n < 25)
		cout << "-1" << endl;
	else
	{
		int i = 5, flag = 0;
		while (1)
		{
			if (n%i == 0 && n / i >= 5)
			{
				flag = 1;
				break;
			}
			else i++;
			if (i == n) break;
		}
		if (flag == 0)
			cout << "-1" << endl;
		else
		{
			string s = "";
			for (int j = 0; j < i; j++)
				for (int k = 0; k < n / i; k++)
					cout << s[j + k];
			cout << endl;
		}
	}
}